import React, {Component} from 'react';
import {
    Contact,
    CouchSerfing,
    FaceBook,
    GitHub,
    Gmail,
    Instagram,
    LinkedIn,
    Skype,
    Stack,
    Telegram,
    Website
} from "./util";

// import {
//     CouchSerfingLink,
//     FaceBookLink,
//     GitHubLink,
//     InstagramLink,
//     LinkedInLink,
//     SkypeLink,
//     StackLink,
//     TelegramLink,
//     WebsiteLink
// } from './util'



class App extends Component {
    goToPage =(page)=>{
        switch (page) {
            case 'website':
                console.log(page)
                break;

            case 'github':
                console.log(page)
                break;

            case 'facebook':
                console.log(page)
                break;

            case 'instagram':
                console.log(page)
                break;

            case 'linkedIn':
                console.log(page)
                break;

            case 'couchSerfing':
                console.log(page)
                break;

            case 'stack':
                console.log(page)
                break;


            default:
                console.log('def')
                break;
        }
    };


    render() {

        return (
            <div className={'container-fluid main '}>

                <div className="container">
                    <p className={'text-center pt-1'}>
                        Lorem ipsum dolor sit amet,
                        consectetur adipisicing elit.
                        Accusamus ad alias aut beatae corporis
                        dolores eum fuga fugiat impedit
                        inventore iure magni nam quidem,
                        quod reprehenderit sunt tenetur voluptatem
                        voluptates?</p>
                </div>


                <div className="container row pt-2 ">
                    <img src={Website} onClick={()=>this.goToPage('website')} alt={'#'} className={'col-4'}/>
                    <img src={GitHub} onClick={()=>this.goToPage('github')} alt={'#'} className={'col-4'}/>
                    <img src={Telegram} alt={'#'} className={'col-4 text-right'}/>
                </div>

                <div className="container row mt-5">
                    <img src={FaceBook} onClick={()=>this.goToPage('facebook')} alt={'#'} className={'col-4 '}/>
                    <img src={Instagram} onClick={()=>this.goToPage('instagram')} alt={'#'} className={'col-4'}/>
                    <img src={LinkedIn} onClick={()=>this.goToPage('linkedIn')} alt={'#'} className={'col-4'}/>
                </div>

                <div className="container row mt-5">
                    <img src={CouchSerfing} onClick={()=>this.goToPage('couchSerfing')} alt={'#'} className={'col-4'}/>
                    <img src={Contact} alt={'#'} className={'col-4'}/>
                    <img src={Skype} alt={'#'} className={'col-4 '}/>

                </div>

                <div className="container row mt-5 ">
                    <img src={Stack} onClick={()=>this.goToPage('stack')} alt={'#'} className={'col-4 '}/>
                    <div className="offset-4"></div>
                    <img src={Gmail} alt={'#'} className={'col-4 right'}/>
                </div>
            </div>
        );
    }
}

export default App;
